import NavbarComp from "./partials/Navbar";
import HeaderPresentation from "./HeaderPresentation";

function App() {
  return (
    <>
    <nav>
      <div className="App">
        <NavbarComp />
      </div>
      <div id="header-text">
        <HeaderPresentation />
      </div>
    </nav>

    <section className="container">
      <h2>
        Text here
      </h2>
    </section>
    </>
  );
}

export default App;
